import React from "react";

const Nav = () => {
  return (
    <nav style={styles.container}>
      <ul>
        <li>News Feed</li>
      </ul>
    </nav>
  );
};

export default Nav;

const styles = {
  container: {
    display: "flex",
    flexDirection: "row",
  },
};
